import {
  FormControl,
  InputLabel,
  MenuItem,
  Paper,
  Select,
  Stack
} from '@mui/material';
import makeStyles from '@mui/styles/makeStyles';
import { Header } from './Header';
import { useState } from 'react';
import { Type } from './models';
import { TextInput } from './TextInput';
import setBodyColor from './setBody';

export const CreateRequest = () => {
  const classes = useStyles();
  const [type, setType] = useState('');

  setBodyColor({ color: '#DDFFF7' });

  return (
    <div>
      <Header />
      <Paper elevation={2} className={classes.form}>
        <h1 className={classes.title}>Create Request</h1>
        <Stack spacing={2} direction="row" className={classes.formContainer}>
          <FormControl>
            <InputLabel id="select-request-type">
              Type of the request
            </InputLabel>
            <Select
              labelId="select-request-type"
              value={type}
              label="Type of the request"
              defaultValue={Type.OneTimeTask}
            >
              <MenuItem value={Type.OneTimeTask}>{Type.OneTimeTask}</MenuItem>
              <MenuItem value={Type.MaterialNeed}>{Type.MaterialNeed}</MenuItem>
            </Select>
          </FormControl>
          <TextInput label="Location" onChange={() => {}} />
        </Stack>
        <Stack spacing={2} direction="column" className={classes.formContainer}>
          <TextInput
            label="Description"
            onChange={() => {}}
            placeholder="Description of the request (300 characters maximum)"
            rows={8}
            multiline={true}
          />
        </Stack>
      </Paper>
    </div>
  );
};

const useStyles = makeStyles({
  title: {
    display: 'flex',
    justifyContent: 'center'
  },
  form: {
    width: '600px',
    margin: 'auto',
    marginTop: '150px',
    padding: '60px'
  },
  formContainer: {
    display: 'flex',
    justifyContent: 'center',
    alignItems: 'center'
  }
});
